import Header from "./components/Header"
import { UserContextProvider } from 'context/userContext';
//import './App.css';

const App = () => (

<div className="App">
    <Router>
        <Header />
        <Routes>
            <Route path="/" element={<DishList />} />
            <Route path="/login" element={<UserLogin />} />
            <Route path="/NewDish" element={<NewDish />} />
        </Routes>
    </Router>
  </div> 
);

export default App;
